import React from "react";
import EmojiObjectsIcon from "@material-ui/icons/EmojiObjects";
function Header() {
  return (
    <header>
      <h1>
        <EmojiObjectsIcon fontSize="medium" /> Keeper Note
      </h1>
    </header>
  );
}

export default Header;
